The app displays precise locations of moving buses and time of arrival ONLY in the following cities and regions:
- Volgograd
- Ekaterinburg
- Kazan
- Kaliningrad and Kaliningrad Oblast
- Kemerovo and Kemerovo Oblast
- Krasnoyarsk
- Moscow region (excluding Moscow city)
- Omsk
- Pskov
- Saint-Petersburg
- Smolensk region
- Tobolsk
- Yaroslavl region

Unfortunately, cities that are not on the list aren’t supported yet, but we’re working on it.
Hubb app only delivers and represents the information it gets from data providers. In case you come across a situation where the provided information is incorrect, please report an issue by tapping on the exclamation point button. Your feedback will be sent straight to the data provider to resolve the issue.
This simple and useful app will help you track the movements of public transport in real time using GPS and GLONASS in these cities:   St. Petersburg, Krasnoyarsk,  Kazan, Omsk, Kaliningrad, Kemerovo, Kerch, Novokuznetsk,  Pskov, Smolensk, Roslavl, Rostov, Tobolsk, Vyazma, Yekaterinburg, Volgograd, Yaroslavl (only regional transport) .
It also supports intercity transport of Moscow region, Kemerovo region, Smolensk region, Yaroslavl region and Pskov region.
We’re the best because:

- the app shows available transport on a map or on a list in a user-friendly way;
- it can determine your location and immediately suggest the nearest bus stop;
- you can locate buses passing through a selected stop and get the estimated times of arrival;
Krasnoyarsk citizens can track their transport card balance;
you can add frequently used stops (near your work or your home) and routes to Favorites.
the app always shows the relevant information when it comes to weekend/holiday changes of the routes and schedules;
you’ll always be on time and won’t catch a cold waiting for your bus;
- Material Design support.

Soon:
- notifications about your transport arrival;
- customize notifications to get to your stop in time;
- intercity buses schedule;
- estimation of the utilized capacity of the transport;
- bike lanes and parking;
- Yandex-enabled traffic jams info;
- notifying you about route changes;
- offline mode;
- showing the model, the registration number and whether it’s a low-floor transport;
- a widget for quick access to your Favorites.

Coming to your city soon!

Dear customer!
We are a young team of developers from Krasnoyarsk and we’ll be happy if you help us test and share Hubb among your friends.
If you think we deserve a negative review, please include a message describing your problem! You can contact us at thanks@hubbmap.com for feedback.

